# OEIS sequence: A337496

def A337496(N):
    A337496_n=[0,1]
    for j in range(2,N+1):
        A337496_n.append(2)
    for b in range(3,((N+1)//2) +1):
        n=2*b-1
        while n<=N:
            s=0
            m=n//b
            while m%b==b-2:
                s=s+1
                m=m//b
            x=b*((b**s)-1)//(b-1)
            for i in range(n, min(N,x+n)+1):
                A337496_n[i]+=1
            n=n+x+b
    return(A337496_n)
